 Malzemeler:
Tavuk (istediğiniz yerinden olabilir. Göğüs kısmı daha sağlıklı bir tercih.)
Tam buğday unu
1 yumurta 
Corn flakes 
  Yapılışı:
Tavukları dilediğiniz baharatlar ile soslayıp marine edin.
Bir tabağa un bir tabağa yumurta bir tabağa corn flakesleri koyun.
Bu aşamada bir eliniz una bir eliniz yumurta ve corn flakese değmeli ki un ellerinize yapışmasın.
Bir elinizle tavuğu unlayın. Fazla ununu silkin. Tavuğu diğer elinize alarak yumurtaya bulayın ve yine fazlasını silkin. Aynı elle corn flakese bulandırıp yağlı kağıt serilmiş  fırın tepsisine koyun.
Tüm tavuklara bu işlemi uygulayın.
Önceden ısıtılmış 180 derece fırında 30 dakika pişirin.
 Servis için;
Nane ve yoğurtla bir sos yaptım. Yanına da tam buğday lavaş koydum.

